import Post from "../post/Post";
import "./posts.css";

export default function Posts() {
  return (
    <div className="posts">
      <Post img="https://images.jmcatalog.com/prdimgs/pRe9cisi9/CLOROX/450/CLOROX02452.JPG" />
      <Post img="https://i5.peapod.com/c/1G/1G48T.png" />
      <Post img="https://images.heb.com/is/image/HEBGrocery/001518784"/>
      <Post img="https://images.pexels.com/photos/5490778/pexels-photo-5490778.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500"/>
      <Post img="https://images.pexels.com/photos/4916559/pexels-photo-4916559.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500"/>
    </div>
  );
}
